import React from "react";
import "./navBar.css";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
}));

const NavBar = () => {
  const classes = useStyles();
  return (
    <header className={classes.root}>
      <Grid container spacing={3} className="navBar">
        <Grid item xs={12}>
            <a className="logo" href="/">
              <span className="logoImg">
                <img src="/src/image/filmnet-logo.png" alt="logo" />
              </span>
            </a>
          <div className="navBarItems">
            <ul className="">
              <li className="navBarItem"><a href="/" className="navBarLink">دسته بندی ها </a></li>
              <li className="navBarItem"><a href="/" className="navBarLink">تازه های فیلمنت</a></li>
              <li className="navBarItem"><a href="/" className="navBarLink">فیلم ایرانی</a></li>
              <li className="navBarItem"><a href="/" className="navBarLink">سریال</a></li>
              <li className="navBarItem"><a href="/" className="navBarLink">انیمیشن</a></li>
              <li className="navBarItem"><a href="/" className="navBarLink">6</a></li>
            </ul>
          </div>
          <div className="navBarBtns">
            <ul className="">
              <li className="navBarBtn">1</li>
              <li className="navBarItem">2</li>
            </ul>
          </div>
        </Grid>
      </Grid>
    </header>
  );
};
export default NavBar;
